import React, { useEffect, useState, useRef } from "react";
import { Client } from "@stomp/stompjs";
import SockJS from "sockjs-client";

export default function Dashboard() {
  const [machines, setMachines] = useState([]);
  const clientRef = useRef(null);
  const user = { id: 1, name: "xyz" };

  useEffect(() => {
    const client = new Client({
      webSocketFactory: () => new SockJS("http://localhost:8080/ws"),
      reconnectDelay: 5000,
      onConnect: () => {
        client.subscribe("/topic/machines", (msg) => {
          try {
            const body = JSON.parse(msg.body);
            setMachines(body);
          } catch (e) {
            console.error(e);
          }
        });
      }
    });
    client.activate();
    clientRef.current = client;

    fetch("http://localhost:8080/api/machines")
      .then((r) => r.json())
      .then((data) => setMachines(data))
      .catch((e) => console.error("fetch machines", e));

    return () => {
      if (clientRef.current) clientRef.current.deactivate();
    };
  }, []);

  function remainingSeconds(endTime) {
    if (!endTime) return 0;
    const diff = Math.floor(new Date(endTime).getTime() / 1000 - Date.now() / 1000);
    return diff > 0 ? diff : 0;
  }

  function fmt(sec) {
    const m = Math.floor(sec / 60);
    const s = sec % 60;
    return `${m}m ${s}s`;
  }

  async function joinQueue(machineId) {
    const res = await fetch("http://localhost:8080/api/machines/join", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ machineId, userId: user.id })
    });
    const j = await res.json();
    if (res.ok) alert("Queued. Position: " + j.position);
    else alert("Error: " + JSON.stringify(j));
  }

  async function startWashing(machineId) {
    const minutesStr = prompt("Enter minutes for wash (e.g., 50):", "50");
    if (!minutesStr) return;
    const minutes = parseInt(minutesStr || "50", 10) || 50;
    const res = await fetch("http://localhost:8080/api/machines/start", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ machineId, userId: user.id, minutes })
    });
    const j = await res.json();
    if (res.ok) {
      if (j.started) alert("Started until: " + j.endTime);
      else if (j.error) alert("Error: " + j.error);
    } else alert("Error: " + JSON.stringify(j));
  }

  return (
    <div className="container">
      <div className="header">
        <div><h3>WashSimple â€” user: {user.name}</h3></div>
        <div><small>Open multiple tabs to test realtime sync</small></div>
      </div>
      <div className="machine-grid">
        {machines.map((m) => {
          const rem = remainingSeconds(m.endTime);
          const isOwner = Number(m.currentUserId) === user.id;
          return (
            <div className="card" key={m.id}>
              <h4>{m.name}</h4>
              <div><b>Status:</b> {m.inUse ? "In use" : "Free"}</div>
              <div><b>Queue:</b> {m.queueSize}</div>
              {m.inUse && <div><b>Remaining:</b> {fmt(rem)}</div>}
              <div style={{ marginTop: 10 }}>
                <button onClick={() => joinQueue(m.id)} disabled={isOwner}>Join Queue</button>
                <span style={{ marginLeft: 8 }} />
                <button onClick={() => startWashing(m.id)} disabled={m.inUse && !isOwner}>
                  {isOwner ? "Start/Extend" : "Start"}
                </button>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}
